import React,{Component} from 'react';

class Counter extends Component{
    constructor(){
        super()
        this.state={
            count:0
        }
    }
    increment(){
        this.state.count=this.state.count+1
    }
    render(){
        return(
            <div>
                <h1>count - {this.state.count}</h1>
                <button onClick={()=>this.increment()}>increment</button>
            </div>
        )
    }
}

export default Counter;
